	add("pseudohallucination", "{\"term\":\"pseudohallucination\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|hallucination|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A brief but vivid visual or auditory experience that is recognised as being unreal\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudohalogen", "{\"term\":\"pseudohalogen\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|halogen|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A binary inorganic compound with a structure similar to that of the halogens but containing at least one non-halogen radical such as cyanide\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudohermaphrodite", "{\"term\":\"pseudohermaphrodite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|hermaphrodite|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An individual that has the external genitalia of one sex, but the internal sex organs of the other\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudohermaphroditism", "{\"term\":\"pseudohermaphroditism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|hermaphroditism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A condition in which an individual has the internal reproductive organs of one sex but the external genitalia of the other\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudohomolog", "{\"term\":\"pseudohomolog\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|homolog|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a pair of lanthanides or actinides and related transition elements that have similar chemical properties because of similar electronic structure\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudohyperaldosteronism", "{\"term\":\"pseudohyperaldosteronism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|hyperaldosteronism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A medical condition that mimics hyperaldosteronism\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Eating large amounts of liquorice can lead to \u0027\u0027pseudohyperaldosteronism\", \"priority\":2}]}, \"synonyms\":{}}");

	add("pseudohypertrophy", "{\"term\":\"pseudohypertrophy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|hypertrophy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Enlargement at the site of an organ or part resulting from an increase in size or number of a separate tissue\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Early signs of Duchenne muscular dystrophy may include \u0027\u0027pseudohypertrophy\u0027\u0027 (enlargement of calf muscles), low endurance, and difficulties in standing unaided or inability to ascend staircases\", \"priority\":2}]}, \"synonyms\":{}}");

	add("pseudoincest", "{\"term\":\"pseudoincest\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|incest|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Sexual activity between family members who are not blood relations (e.g., siblings by adoption, stepparents and stepchildren, in-laws\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Esperanza Ramirez-Christensen, \u0026quot;Introduction\u0026quot;, in \u0027The Father-Daughter Plot: Japanese Literary Women and the Law of the Father\u0027 (eds. Rebecca L. Copeland \u0026amp; Esperanza Ramirez-Christensen), University of Hawai\u0027i Press (2001), ISBN 9780824824389, [https://books.google.com/books?id\u003dCWFdhYBn8-MC\u0026amp;pg\u003dPA4\u0026amp;dq\u003d%22pseudoincest%2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22pseudoincest%22\u0026amp;f\u003dfalse page 4\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"One of the most disturbing scenes in this narrative is surely the night he deflowers the still childlike girl whom he has been rearing as an adopted daughter, making her his wife. This act, striking the modern reader as no different from father-daughter rape or incestuous abuse, momentarily tears apart the haze of aesthetic/erotic illusion and makes one wonder about the reality of paternal domination behind the fiction of \u0027\u0027pseudoincest\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, David Garrett Izzo, \u0027The Writings of Richard Stern: The Education of an Intellectual Everyman\u0027, McFarland \u0026amp; Company (2002), ISBN 9780786480937, [https://books.google.com/books?id\u003d3xA3DPFMgc4C\u0026amp;pg\u003dPA84\u0026amp;dq\u003d%22pseudoincest+factor%22 page 84\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"What really matters within the overall plot is that while Sam, who is 57, tries to clear his son, he meets his son\u0027s former lover, Jacqueline, who was a very young French operative during the war and still is very young shortly after it. They begin an affair. There is a \u0027\u0027pseudoincest\u0027\u0027 factor ripe enough to raise a jaded Freud\u0027s eyebrows and just as many twists of fate to fool even Tiresias\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Graham Joyce, \u0026quot;Narrative and Regeneration: \u0027The Little Monsters Of Templeton\u0027 by Lauren Groff\u0026quot;, \u002721st-century Gothic: Great Gothic Novels Since 2000\u0027 (ed. Danel Olson), Scarecrow Press (2011), ISBN 9780810877283, [https://books.google.com/books?id\u003d9wLv2fEGnpkC\u0026amp;pg\u003dPA451\u0026amp;dq\u003d%22pseudoincest%22 pages 450-451\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The suggestion that Heathcliff was Earnshaw\u0027s illegitimate child won\u0027t go away. What \u0027is\u0027 unthinkable is that this never occurred to Emily Brontë. The implication is a structural ghost that twists and shapes the subsequent narrative. We are not dealing with \u0027\u0027pseudoincest\u0027\u0027 at all, but incest in all its colors\", \"priority\":8}]}, \"synonyms\":{}}");

	add("pseudointellectual", "{\"term\":\"pseudointellectual\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|t1\u003dfalse, fake|intellectual|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who affects proficiency in scholarly and artistic pursuits whilst lacking any in-depth knowledge or critical understanding of such topics\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person who pretends to be of greater intelligence than he or she in fact is\", \"priority\":2}]}, \"synonyms\":{}}");

	add("pseudolaueite", "{\"term\":\"pseudolaueite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|laueite|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A monoclinic-prismatic orange mineral containing hydrogen, iron, manganese, oxygen, and phosphorus\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudologic", "{\"term\":\"pseudologic\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|gloss1\u003dfalse|logic|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"False logic. A logical argument that deliberately omits an outcome so that a false conclusion is reached\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudomalachite", "{\"term\":\"pseudomalachite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|malachite|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mineral containing copper, hydrogen, oxygen, and phosphorus\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudometallophyte", "{\"term\":\"pseudometallophyte\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|metallophyte|lang\u003den}}, from {{confix|metallo|phyte|t1\u003dmetal|t2\u003dplant|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any plant that can tolerate a high metal content in its environment, but also thrives under normal conditions\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudomorph", "{\"term\":\"pseudomorph\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|pseudo|gloss1\u003dfalse|morph|gloss2\u003dform|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mineral that formed by replacement of an existing mineral (or organic matter) such that the new mineral has the appearance and dimensions of the original\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudomorphism", "{\"term\":\"pseudomorphism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|pseudo|morphism|lang\u003den}} or {{suffix|pseudomorph|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of having, or the property of taking, a crystalline form unlike that which belongs to the species\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudomugilid", "{\"term\":\"pseudomugilid\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any member of the\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudonym", "{\"term\":\"pseudonym\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From \u0027\u0027 from French {{m|fr|pseudonyme||having a false name}}, from Ancient greek (to 1453) {{m|grc|ψευδώνυμος}}, from {{m|grc|ψευδής||false}} and {{m|grc|ὄνυμα}}, from {{m|grc|ὄνομα||name}}. Alternatively, analyzable as {{confix|pseudo|onym|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fictitious name, as those used by writers and movie stars\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The Reverend Charles Lutwidge Dodgson wrote \u0026quot;Alice\u0027s Adventures in Wonderland\u0026quot; under the \u0027\u0027pseudonym\u0027\u0027 Lewis Carroll\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"w:H. G. H. G. Wells, \u0027s:The Obliterated The Obliterated Man\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I doubt, indeed, whether I should not abandon the struggle altogether—leave this sad world of ordinary life for which I am so ill fitted, abandon the name of Cummins for some professional \u0027\u0027pseudonym\u0027\u0027, complete my self-effacement, and—a thing of tricks and tatters, of posing and pretence—go upon the stage\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1928\u0027\u0027, w:H.P. H.P. Lovecraft, \u0027s:Supernatural Horror in Supernatural Horror in Literature\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The best example of its literary use so far are the German novel \u0027The Golem\u0027, by Gustav Meyrink, and the drama \u0027The Dybbuk\u0027, by the jewish writer using the \u0027\u0027pseudonym\u0027\u0027 \u0026quot;Ansky\u0026quot\", \"priority\":6}]}, \"synonyms\":{}}");

	add("pseudopenis", "{\"term\":\"pseudopenis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|penis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The enlarged clitoris of the female of various species including spotted hyena, binturong, and lemur\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudophilosophy", "{\"term\":\"pseudophilosophy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|philosophy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any philosophical system that does not meet mainstream academic standards\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudophotograph", "{\"term\":\"pseudophotograph\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|photograph|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A photorealistic painting\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A photographic image that has been digitally manipulated or stored\", \"priority\":2}]}, \"synonyms\":{}}");

	add("pseudoplasmodium", "{\"term\":\"pseudoplasmodium\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|plasmodium|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A multicellular assembly formed by dictyostelid amoebae\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudopod", "{\"term\":\"pseudopod\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|pseudo|pod|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A temporary projection of the cytoplasm of certain cells, such as phagocytes, or of certain unicellular organisms, such as amoebas, that serves in locomotion\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A projection acting as a foot in certain insect larvae\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"By extension, an extension or projection from something\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1937\u0027\u0027, ‘The Salem Horror’\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027pseudopod\u0027\u0027 of blackness elongated itself from the central mass and like a great tentacle clutched the corpse-like being, dragged it back to the pit and over the brink\", \"priority\":5}]}, \"synonyms\":{}}");

	add("pseudoprecision", "{\"term\":\"pseudoprecision\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|precision|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A spurious appearance of precision, as for example when an inaccurate figure is given to very many decimal places\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudoprime", "{\"term\":\"pseudoprime\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|prime|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An integer that possesses at least one characteristic of a prime number without actually being prime\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudoprofession", "{\"term\":\"pseudoprofession\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|profession|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A job that is not considered a true profession, but has many characteristics of a professio\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudopseudohypoparathyroidism", "{\"term\":\"pseudopseudohypoparathyroidism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|pseudo|pseudohypoparathyroidism|gloss1\u003dfalse|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mild inherited condition in which the sufferer has symptoms similar to those of pseudohypoparathyroidism\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Dominique N. Long, Sarah McGuire, Michael A. Levine, Lee S. Weinstein, Emily L. Germain-Lee, \u0027Body Mass Index Differences in Pseudohypoparathyroidism Type 1a Versus \u0027\u0027Pseudopseudohypoparathyroidism\u0027\u0027 May Implicate Paternal Imprinting of Gαs in the Development of Human Obesity\u0027, \u0027Journal of Clinical Endocrinology \u0026amp; Metabolism\u0027, Volume 92, no. 3, [http://jcem.endojournals.org/content/92/3/1073.long pages 1073-1079\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Because Gαs is paternally imprinted in certain hormone target tissues, maternal inheritance of AHO leads to multihormone resistance [pseudohypoparathyroidism type 1a (PHP1a)], whereas paternal inheritance leads to AHO alone [\u0027\u0027pseudopseudohypoparathyroidism\u0027\u0027 (pseudoPHP)]. Classically, the obesity in AHO is described as occurring similarly in both conditions\", \"priority\":3}]}, \"synonyms\":{}}");

	add("pseudopupa", "{\"term\":\"pseudopupa\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|pupa|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A stage intermediate between the larva and pupa of bees and certain other hymenopterous insects\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudorabies", "{\"term\":\"pseudorabies\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|pseudo|rabies|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A highly contagious herpes virus infection that affects the central nervous system of many animals\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudoradical", "{\"term\":\"pseudoradical\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|radical|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who only claims or appears to be a political radical\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The intersection of the set of nonzero prime ideals of a ring\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An atom or group within a molecule which behaves like a free radical due to high valence\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1971\u0027\u0027, Ernest I. Becker, Minoru Tsutsui, \u0027Organometallic Reactions\u0027, John Wiley \u0026amp; Sons (ISBN 9780471061304\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"As suggested by Weinmayr in this example, the reaction proceeds by a different mechanism, not with the formation of free radicals but rather with separation of the C — Hg bond, thus producing \u0027\u0027pseudoradicals\u0027\u0027 which do not diffuse into the reaction medium\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Willy J. Masschelein, Rip G. Rice, \u0027Ultraviolet Light in Water and Wastewater Sanitation\u0027, CRC Press (ISBN 9781420032178), page 5\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"These \u0027\u0027pseudoradicals\u0027\u0027 are not directly chain carriers in the reduction of peroxydisulfate, but they can further build up oxygen radical ions\", \"priority\":7}]}, \"synonyms\":{}}");

	add("pseudorandomness", "{\"term\":\"pseudorandomness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|pseudorandom|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being pseudorandom\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudorealism", "{\"term\":\"pseudorealism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|realism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A dramatic technique in which an altered view of reality is presented as being real\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudoreligion", "{\"term\":\"pseudoreligion\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|religion|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Non-mainstream belief or philosophy with certain aspects of religion (a founder, a principal text, faith-based beliefs, etc\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudoreplicate", "{\"term\":\"pseudoreplicate\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|replicate|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a group of interdependent data that are mistakenly treated as independent\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudorevolution", "{\"term\":\"pseudorevolution\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|revolution|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A political event resembling, but not actually, a revolution\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudorotaxane", "{\"term\":\"pseudorotaxane\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|rotaxane|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any complex, having the general form of a rotaxane, but in which the linear component does not have bulky end groups\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudoscalar", "{\"term\":\"pseudoscalar\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|scalar|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A quantity that behaves like a scalar, but changes sign under a parity inversion\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudoscientist", "{\"term\":\"pseudoscientist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|scientist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A practitioner of pseudoscience\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1972\u0027\u0027, Michael Martin, \u0027Concepts of Science Education: A Philosophical Analysis\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027pseudoscientist\u0027\u0027 will claim that these theories are well supported by the evidence\", \"priority\":3}]}, \"synonyms\":{}}");

	add("pseudoscope", "{\"term\":\"pseudoscope\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|scope|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An optical instrument that reverses perception of depth\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudoscorpion", "{\"term\":\"pseudoscorpion\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|scorpion|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"an arachnid belonging to the order Pseudoscorpionida, also known as \u0027\u0027 or\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudoscutum", "{\"term\":\"pseudoscutum\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|scutum|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A structure resembling a scutum\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudosinhalite", "{\"term\":\"pseudosinhalite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A monoclinic-prismatic colorless mineral containing aluminum, boron, hydrogen, magnesium, and oxygen\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudosociology", "{\"term\":\"pseudosociology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|lang\u003den|pseudo|sociology}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A false or superficial version of sociology\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Real theological thinking was thinking with the mind of Christ, not engaging in what he termed pseudopsychology, \u0027\u0027pseudosociology\u0027\u0027, and pseudo-social work\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In this way, the sociological view appropriate to the Marxist theory of law became a \u0027\u0027pseudosociology\", \"priority\":3}]}, \"synonyms\":{}}");

	add("pseudosphere", "{\"term\":\"pseudosphere\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|sphere|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A surface generated by rotating a tractrix about its asymptote; a tractricoi\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any of various surfaces with constant negative Gaussian curvature\", \"priority\":2}]}, \"synonyms\":{}}");

	add("pseudosubstrate", "{\"term\":\"pseudosubstrate\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|substrate|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any substance that mimics the substrate of an enzyme and thus inhibits its activity\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudosulcus", "{\"term\":\"pseudosulcus\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|sulcus|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A groove that has the appearance of a sulcus\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pseudotachylite", "{\"term\":\"pseudotachylite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pseudo|tachylyte|alt2\u003dtachylite|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A dark, glassy rock generated by frictional heat within faults\", \"priority\":1}]}, \"synonyms\":{}}");

